  false,\n\t\"url\": null,\n\t\"notes\": \"EarthData International collected ADS-40/ISTAR-derived
  orthophotography over Hillsborough, Pinellas, Manatee and Sarasota Counties Florida
  with a 1 foot pixel resolution. The period of collection was between 9 January and
  20 January 2007 for the base area with the agricultural area bring flown between
  17 February and 19 February 2007. The collection was performed EarthData Aviation,
  using a Leica ADS-40 camera system, including an inertial measuring unit (IMU) and
  a dual frequency GPS receiver. This project required eight lifts of flight lines
  to be collected, for a total of 80 flight lines. The orthophotos were rectified
  using the existing lidar DEM from Pinellas County and a collected DEM from Hillsborough
  County and was processed using ISTAR. Ground survey services in support of the project
  were provided by a Florida-registered professional land surveyor under the employment
  of Terrasurv Inc. of PA.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
